import React, { useEffect, useState } from "react"
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { useDispatch, useSelector } from "react-redux";
import { dialogClasses } from "@mui/material";
import { getData } from '../redux/actions'



function Dish() {

    let ingridient = []
    const dispatch = useDispatch();
    const dataDish = useSelector(state => state.dish.data)
    console.log(dataDish);

    useEffect(() => {
        dispatch(getData())
    }, [dispatch])


    return (
        (dataDish != undefined) ?
            <div className="dishItems">
                <Card sx={{ maxWidth: 345 }}>
                    <CardMedia
                        component="img"
                        height="140"
                        image={dataDish.meals[0].strMealThumb}
                        alt="green iguana"
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            {dataDish.meals[0].strArea} , {dataDish.meals[0].strCategory}
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            <li>{dataDish.meals[0].strIngredient1}</li>
                            <li>{dataDish.meals[0].strIngredient2}</li>
                            <li>{dataDish.meals[0].strIngredient3}</li>
                            <li>{dataDish.meals[0].strIngredient4}</li>
                            <li>{dataDish.meals[0].strIngredient5}</li>
                            <li>{dataDish.meals[0].strIngredient6}</li>
                            <li>{dataDish.meals[0].strIngredient7}</li>
                            <li>{dataDish.meals[0].strIngredient8}</li>
                            <li>{dataDish.meals[0].strIngredient9}</li>
                            <li>{dataDish.meals[0].strIngredient10}</li>
                            <li>{dataDish.meals[0].strIngredient11}</li>
                            <li>{dataDish.meals[0].strIngredient12}</li>
                            <li>{dataDish.meals[0].strIngredient13}</li>
                            <li>{dataDish.meals[0].strIngredient14}</li>
                            <li>{dataDish.meals[0].strIngredient15}</li>
                            <li>{dataDish.meals[0].strIngredient20}</li>
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">Share</Button>
                        <Button size="small">Learn More</Button>
                    </CardActions>
                </Card>
            </div>
            : <div> pusto </div>
    )

}





export default Dish;
